import React from 'react';

const PlanetCard = (props) => {
    return(
        <div>
            <p>Climate: {props.Climate}</p>
            <p>Diameter: {props.Diameter}</p>
            <p>Gravity: {props.Gravity}</p>
            <p>Name: {props.Name}</p>
        </div>
    );
}

export default PlanetCard;
